import React, { useState } from 'react';
import { useUser } from '../../context/UserContext';
import { useCart } from '../../context/CartContext';

const Header = () => {
  const { toggleMobileMenu, closeMobileMenu } = useUser();
  const { itemCount } = useCart();
  const [searchQuery, setSearchQuery] = useState('');
  const [isSearchFocused, setIsSearchFocused] = useState(false);

  const handleSearch = (e) => {
    e.preventDefault();
    // TODO: Implement search functionality
    console.log('Search query:', searchQuery);
  };

  return (
    <>
      {/* Header Top */}
      <div className="bg-white border-b border-cultured py-2.5 hidden md:block">
        <div className="container mx-auto px-4">
          <div className="flex justify-center items-center">
            <p className="text-sonic-silver text-fs-9 uppercase">
              Free shipping on orders over $50 | <span className="font-weight-500">Get 20% off</span>
            </p>
          </div>
        </div>
      </div>

      {/* Header Main */}
      <header className="bg-white border-b border-cultured">
        <div className="container mx-auto px-4">
          <div className="flex items-center justify-between py-5 gap-20">
            {/* Logo */}
            <div className="flex-shrink-0">
              <a href="/" className="block">
                <img
                  src="/images/logo/logo.svg"
                  alt="Anon E-commerce"
                  className="h-10 w-auto transition-transform duration-300 hover:scale-105"
                />
              </a>
            </div>

            {/* Search Container */}
            <div className="flex-1 max-w-md">
              <form onSubmit={handleSearch} className="relative">
                <input
                  type="search"
                  value={searchQuery}
                  onChange={(e) => setSearchQuery(e.target.value)}
                  onFocus={() => setIsSearchFocused(true)}
                  onBlur={() => setIsSearchFocused(false)}
                  placeholder="Search products..."
                  className={`w-full py-2.5 px-4 pr-12 text-onyx text-fs-7 border rounded-border-radius-md transition-all duration-300 ${
                    isSearchFocused
                      ? 'border-salmon-pink shadow-md'
                      : 'border-cultured hover:border-salmon-pink'
                  }`}
                />
                <button
                  type="submit"
                  className={`absolute right-2 top-1/2 transform -translate-y-1/2 text-onyx text-lg p-2 rounded-border-radius-md transition-colors duration-300 ${
                    isSearchFocused
                      ? 'text-salmon-pink'
                      : 'hover:text-salmon-pink'
                  }`}
                >
                  <i className="fas fa-search"></i>
                </button>
              </form>
            </div>

            {/* Header Actions */}
            <div className="flex items-center gap-4">
              {/* User Account */}
              <button className="text-onyx text-2xl p-1.5 hover:text-salmon-pink transition-colors duration-300">
                <i className="fas fa-user"></i>
              </button>

              {/* Wishlist */}
              <button className="text-onyx text-2xl p-1.5 hover:text-salmon-pink transition-colors duration-300">
                <i className="fas fa-heart"></i>
              </button>

              {/* Cart */}
              <button className="relative text-onyx text-2xl p-1.5 hover:text-salmon-pink transition-colors duration-300">
                <i className="fas fa-shopping-bag"></i>
                {itemCount > 0 && (
                  <span className="absolute -top-1 -right-1 bg-bittersweet text-white text-xs font-weight-500 px-1 py-0.5 rounded-full min-w-[18px] text-center">
                    {itemCount}
                  </span>
                )}
              </button>

              {/* Mobile Menu Toggle */}
              <button
                onClick={toggleMobileMenu}
                className="md:hidden text-onyx text-2xl p-1.5 hover:text-salmon-pink transition-colors duration-300"
              >
                <i className="fas fa-bars"></i>
              </button>
            </div>
          </div>
        </div>
      </header>

      {/* Desktop Navigation */}
      <nav className="bg-white border-b border-cultured hidden md:block">
        <div className="container mx-auto px-4">
          <ul className="flex justify-center items-center gap-8 py-4">
            <li>
              <a href="/" className="text-onyx text-fs-7 font-weight-600 uppercase hover:text-salmon-pink transition-colors duration-300">
                Home
              </a>
            </li>
            <li>
              <a href="/shop" className="text-onyx text-fs-7 font-weight-600 uppercase hover:text-salmon-pink transition-colors duration-300">
                Shop
              </a>
            </li>
            <li>
              <a href="/categories" className="text-onyx text-fs-7 font-weight-600 uppercase hover:text-salmon-pink transition-colors duration-300">
                Categories
              </a>
            </li>
            <li>
              <a href="/about" className="text-onyx text-fs-7 font-weight-600 uppercase hover:text-salmon-pink transition-colors duration-300">
                About
              </a>
            </li>
            <li>
              <a href="/contact" className="text-onyx text-fs-7 font-weight-600 uppercase hover:text-salmon-pink transition-colors duration-300">
                Contact
              </a>
            </li>
          </ul>
        </div>
      </nav>
    </>
  );
};

export default Header;
